  ( 
    select
      t1.t_member_id, 
      t2.platform      
    from
      suj_db2.l_member_logins as t1
	left join suj_db2.t_members as t2 on t1.t_member_id = t2.id
    where
    @1
    and t2.exp>7
    group by
      t1.t_member_id
  ) as t3 
group by platform;
